import { Component, OnInit } from '@angular/core';
import { ExerciseService } from './ExerciseService'; // Replace with the correct path
import { Exercise } from './Exercise'; // Replace with the correct path

@Component({
  selector: 'app-your-calendar',
  templateUrl: './your-calendar.component.html',
  styleUrls: ['./your-calendar.component.css']
})
export class YourCalendarComponent implements OnInit {
  days: string[] = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
  exercisesByDay: { [key: string]: Exercise[] } = {};

  constructor(private exerciseService: ExerciseService) {}

  ngOnInit(): void {
    this.fetchExercises();
  }

  fetchExercises(): void {
    this.exerciseService.getExercises().subscribe(
      (exercises: Exercise[]) => {
        exercises.forEach(exercise => {
          if (this.days.includes(exercise.day)) {
            if (!this.exercisesByDay[exercise.day]) {
              this.exercisesByDay[exercise.day] = [];
            }
            this.exercisesByDay[exercise.day].push(exercise);
          }
        });
      },
      error => {
        console.error('Error fetching exercises:', error);
        // Handle error if needed
      }
    );
  }
}
